import { useEffect, useState } from "react";

// async function animeData() {
//   const res = await fetch(
//     "https://api.jikan.moe/v4/anime?q=jujutsu kaisen&sfw"
//   );
//   const data = await res.json();

//   console.log(data);
// }

// let myData = animeData();
// console.log(myData);
export default function ContentDetails() {
  const [chosen, setChosen] = useState([]);
  // const [search, setSearch] = useState([]);

  useEffect(
    function () {
      async function getData() {
        const controller = new AbortController();
        const res = await fetch(
          "https://api.jikan.moe/v4/anime?q=jujutsu kaisen&sfw",
          { signal: controller.signal }
        );
        const data = await res.json();
        setChosen(data.data);
      }
      getData();
      console.log(chosen[0]);
      return function () {
        controller.abort();
      };
    },
    [chosen]
  );

  return (
    <div className="content-details-container">
      <div className="item-poster-box">
        <img
          src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
          alt="k"
        />
      </div>
      {/* <Aside chosen={chosen} /> */}
      <Status />
      <p className="item-description">
        Idly indulging in baseless paranormal activities with the Occult Club,
        high schooler Yuuji Itadori spends his days at either the clubroom or
        the hospital, where he visits his bedridden grandfather. However, this
        leisurely lifestyle soon takes a turn for the strange when he
        unknowingly encounters a cursed item. Triggering a chain of supernatural
        occurrences, Yuuji finds himself suddenly thrust into the world of
        Curses—dreadful beings formed from human malice and negativity—after
        swallowing the said item, revealed to be a finger belonging to the demon
        Sukuna Ryoumen, the King of Curses. Yuuji experiences first-hand the
        threat these Curses pose to society as he discovers his own newfound
        powers. Introduced to the Tokyo Prefectural Jujutsu High School, he
        begins to walk down a path from which he cannot return—the path of a
        Jujutsu sorcerer. [Written by MAL Rewrite]
      </p>
    </div>
  );
}

function Aside({ chosen }) {
  return (
    <div className="aside-item-box">
      <div className="aside-item">
        <span className="aside-item">Type:{chosen[0]?.type}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Episodes:{chosen[0]?.episodes}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Status:{chosen[0]?.status}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Aired:{chosen[0]?.aired}</span>
      </div>
      {/* <div className="aside-item">
        <span className="aside-item">Premiered:{chosen[0]?.pr}</span>
      </div> */}
      <div className="aside-item">
        <span className="aside-item">Producer:{chosen[0]?.producers}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Licensors:{chosen[0]?.licensors}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">
          Studios:{chosen[0]?.studios[0]?.name}
        </span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Source:{chosen[0]?.source}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Theme:{chosen[0]?.themes[0]?.name}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">
          Demographic:{chosen[0]?.demographics[0]?.name}
        </span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Duration:{chosen[0]?.duration}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Rating:{chosen[0]?.rating}</span>
      </div>
    </div>
  );
}

function Status() {
  return (
    <div className="status-box">
      <div className="status-item-score-box">
        <p className="status-item-score">9.09</p>
        <p className="status-item-score-users">Users: 2,093,317 </p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Ranked</span>
        <p className="status-item-value">#2</p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Popularity</span>
        <p className="status-item-value">#3</p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Members</span>
        <p className="status-item-value">3,299,942</p>
      </div>
    </div>
  );
}
